import { ComponentMeta, ComponentStory } from "@storybook/react";
import { useEffect, useState } from "react";

import DataGrid from "./DataGrid";
import { rows as ROWS, cols, cols2, rows2 } from "./dataset";

export default {
  title: "Widget/DataGrid",
  component: DataGrid,
  decorators: [(Story) => <div className="h-[530px] w-full">{Story()}</div>],
} as ComponentMeta<typeof DataGrid>;

const Template: ComponentStory<typeof DataGrid> = (args) => {
  return <DataGrid {...args} />;
};

const rows = [
  ...ROWS,
  ...ROWS,
  ...ROWS,
  ...ROWS,
  ...ROWS,
  ...ROWS,
  ...ROWS,
].map((obj, i) => ({ ...obj, id: i }));

export const Default = Template.bind({});
Default.args = {
  rows,
  columns: cols,
  pageSize: 15,
  paginationStyle: "numbers",
  autoHeight: false,
  rowsPerPageOptions: [15, 30, 50, 100],
  onPageSizeChange: (size) => {
    console.log(size);
  },
  localeText: {
    ...zhTW.components.MuiDataGrid.defaultProps.localeText,
    MuiTablePagination: {
      ...zhTW.components.MuiDataGrid.defaultProps.localeText.MuiTablePagination,
      labelRowsPerPage: "每頁顯示",
    },
  },
};

export const GridPagination = Template.bind({});
GridPagination.parameters = {
  docs: {
    description: {
      story: "",
    },
  },
};
GridPagination.args = {
  ...Default.args,
  paginationStyle: "grid",
};

export const MoreCustomCells = Template.bind({});
MoreCustomCells.parameters = {
  docs: {
    description: {
      story: "",
    },
  },
};
MoreCustomCells.args = {
  ...Default.args,
  rows: rows2,
  columns: cols2,
  paginationStyle: "grid",
};

export const Empty = Template.bind({});
Empty.parameters = {
  docs: {
    description: {
      story: "",
    },
  },
};
Empty.args = {
  ...Default.args,
  rows: [],
  columns: cols2,
  paginationStyle: "grid",
  emptyView: () => (
    <div className="flex h-full w-full items-center justify-center">
      這是客製化的沒有資料
    </div>
  ),
};

type ServerData = typeof serverData;
const serverData = [...ROWS, ...ROWS, ...ROWS, ...ROWS, ...ROWS].map(
  (obj, i) => ({
    ...obj,
    id: i,
  })
);

export const SimulateServerPagination: ComponentStory<typeof DataGrid> = (
  args
) => {
  function loadServerRows(page: number): Promise<unknown[]> {
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve(serverData.slice(page * 10, (page + 1) * 10));
      }, Math.random() * 500 + 100); // simulate network latency
    });
  }

  const [page, setPage] = useState(0);
  const [rows, setRows] = useState<ServerData>([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    let active = true;

    void (async () => {
      setLoading(true);
      const newRows = await loadServerRows(page);

      if (!active) {
        return;
      }

      setRows(newRows as ServerData);
      setLoading(false);
    })();

    return () => {
      active = false;
    };
  }, [page]);

  return (
    <DataGrid
      {...args}
      rows={rows}
      columns={cols}
      pageSize={10}
      rowCount={serverData.length}
      paginationMode="server"
      onPageChange={(newPage) => setPage(newPage)}
      loading={loading}
    />
  );
};
